import ReactDOM from 'react-dom';
import './index.css';


    class listKey extends React.Component() {
        constructor(props,text) {
            this.text = text;
            text = 'Hello';
        }


        onLiteFunc() {
            return(
                 <div>
                <h1>{this.text}</h1>
            </div>
            )

        }

        render() {
            return(
                <div></div>
            )
        }
    }


ReactDOM.render(
    <div className='text'>
        <h1>123</h1>
    </div>,
    document.getElementById('root')
)
